s\":[{\"question\":\"How do i purchase an item from your website?\",\"answer\":\"Our items are sold exclusively on the ThemeForest marketplace. Themeforest is a marketplace for digital goods, mostly themes, and templates for different platforms and software. Why ThemeForest you may ask? Well, they\'re certainly the biggest marketplaces for such products on the web.\"},{\"question\":\"Where can i find a list of the items i purchased from you?\",\"answer\":\"To see a list of items that you\'ve purchased, log in to your ThemeForest account and go to your Downloads section. You can re-download them from here as well.\"},{\"question\":\"Where do i download my products that i\'ve puchased from you?\",\"answer\":\"To download an item that you\'ve purchased, log in to your ThemeForest account and go to your Downloads section. You can re-download them from here as well.\"},{\"question\":\"I\'m being redirected to buy from this website called ThemeForest, is it normal?\",\"answer\":\"Yes, no worries! ThemeForest is a marketplace where we exclusively post and sell our work. Also, payments and purchases are made through ThemeForest.\"},{\"question\":\"What are the payment methods for purchasing?\",\"answer\":\"As mentioned before, payments and purchases are made through ThemeForest. The payment methods are through Paypal and Skrill (MoneyBookers). You can find much more details here https:\\/\\/help.market.envato.com\\/hc\\/en-us\\/articles\\/203269700-How-to-Purchase-Items. Also, keep in mind though that credit card payments will be implemented very soon.\"},{\"question\":\"I really like your templates\\/support. How can i rate it?\",\"answer\":\"Awesome! Thank you so much! You can rate our items in your Downloads section in ThemeForest. On the right column of the listed items, you can see the rating\\/review box.\"}],\"services\":[{\"title\":\"Express Delivery\",\"description\":\"Pickup and deliver the package with the priority delivery service is one of our services which we offer, It provides guaranteed 1-Day or 2-Day deliver\",\"img_name\":\"test\"},{\"title\":\"Collect Money\",\"description\":\"The ability to collect money from the consignee and ship it to the correspondent again in complete security and privacy\",\"img_name\":\"test\"},{\"title\":\"Local Shipping\",\"description\":\"Shipping to and from all provinces and cities Enjoy now shipping your goods door to door and special prices for heavyweights.\",\"img_name\":\"test\"},{\"title\":\"International Shipping\",\"description\":\"Shipping from and to all countries of the world Enjoy shipping your goods door to door and special prices for heavyweights after 50 kg\",\"img_name\":\"test\"}],\"sliders\":[{\"titleslider\":\"FAST, SAFE and ACCURATE\",\"subtitle\":\"ANYWHERE IN THIS WORLD\",\"link\":\"http:\\/\\/spotlayer.com\\/shipment\\/en\\/about\"},{\"titleslider\":\"FAST, SAFE and ACCURATE\",\"subtitle\":\"ANYWHERE IN THIS WORLD\",\"link\":\"http:\\/\\/spotlayer.com\\/shipment\\/en\\/faq\"}]}}'),
